(* ### Problem
 Central angles $a$,$b$, and $c$ separate the circle into regions which are $\frac{1}{3}$, $\frac{1}{4}$, and $\frac{1}{6}$ of the area of the circle respectively. How many degrees are there in central angle $d$?

[asy]
draw(circle((0,0),1));
draw((0,0)--(1,0));
draw((0,0)--(0,1));
draw((0,0)--(1/2,-sqrt(3)/2));
draw((0,0)--(-sqrt(3)/2,-1/2));
label("$b$",(0,0),NE);
label("$c$",(0,0),dir(-30));
label("$d$",(0,0),dir(-100));
label("$a$",(0,0),NW);
[/asy] The final Answer is 90^\circ
 ### Proof
 Angle $d$ covers $1-\frac13-\frac14 -\frac16 = 1 -\frac26-\frac16 - \frac14 = 1 -\frac12 - \frac14 = \frac14$ of the circle, so it has measure $\frac14\cdot 360^\circ = \boxed{90^\circ}$.
 *)

theorem
fixes a b c d :: real
assumes h0 : "a + b + c + d = 360"
and h1 : "a = 360 / 3"
and h2 : "b = 360 / 4"
and h3 : "c = 360 / 6"
shows  "d = 90"
 proof- 
  show ?thesis sledgehammer

